import React from "react";

const Skills = () => {
  return (
    <section id="skills" className="section">
      <h2>Skills</h2>
      <ul>
        <li>HTML, CSS</li>
        <li>JavaScript, React JS, C++</li>
        <li>TypeScript</li>
        <li>Graphic Design, Video Editing</li>
        <li>Git/GitHub</li>
        <li>Academic Writing</li>
      </ul>
    </section>
  );
};

export default Skills;
